/*******************************/
/********* Contact CSS *********/
/*******************************/
.contact {
    position: relative;
    width: 100%;
    padding: 35px 0;
    padding-bottom: 70px;
    background: linear-gradient(
      45deg,
      rgb(1, 24, 54) 11.2%,
      rgba(0, 37, 84, 0.8) 100.2%
    );
    .container{
      h3{
        font-size: 24px;
        color: #fdbe33;
      }
      h2{
        font-size: 37px;
        color: white;
        padding-bottom: 20px;
      }
    }
  }
  
  .contact .contact-img {
    position: relative;
    width: 100%;
  }
  
  .contact .contact-img img {
    width: 100%;
    height: 440px;
    object-fit: cover;
    border-radius: 12px;
    filter: drop-shadow(0 0 1.25rem #FDBE33);
  }
  
  .contact .contact-form {
    position: relative;
    width: 100%;
    max-width: 700px;
    margin: 0 auto;
    margin-top: -220px;
    pad
    padding: 30px;
    background: #f3f6ff;
    border-radius: 12px;
    .sent{
      padding-bottom: 15px;
      text-align: center;
      font-size: 18px;
      font-weight: 500;
      i{
        margin-left: 10px;
      }
    }
  }
  
  @media (max-width: 991.98px) {
    .contact .contact-form {
        max-width: 600px;
    }
  }
  
  @media (max-width: 767.98px) {
    .text-danger{
      font-size: 12px;
    }
    .contact .contact-form .btn.btn-custom {
      padding: 6px;
    }
    .contact .container {
      h3{
        font-size: 21px;
      }
      h2{
        font-size: 31px;
      }
    }
    .contact .contact-form {
        max-width: 400px;
    }
  }
  
  @media (max-width: 575.98px) {
    .contact .contact-form {
        max-width: 300px;
    }
  }
  
  .contact .contact-form input {
    padding: 18px;
    background: none;
    border-radius: 8px;
    border: 1px solid rgba(0, 0, 0, .5);
  }
  
  .contact .contact-form textarea {
    height: 150px;
    padding: 8px 15px;
    background: none;
    border-radius: 8px;
    border: 1px solid rgba(0, 0, 0, .5);
  }
  
  .contact .contact-form .btn.btn-custom {
    width: 100%;
    font-size: 18px;
    font-weight: 500;
    border-radius: 12px;
  }
